function App() {
  return (
    <div style={{ background: "white", padding: "20px", minHeight: "100vh" }}>
      <h1 style={{ color: "black" }}>Test - React is Working!</h1>
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(10, 40px)",
          gap: "2px",
          marginTop: "20px",
        }}
      >
        {Array.from({ length: 100 }).map((_, i) => (
          <div
            key={i}
            style={{
              width: "40px",
              height: "40px",
              border: "1px solid black",
              background: "#eee",
            }}
          >
            {i}
          </div>
        ))}
      </div>
    </div>
  );
}
